/* eslint-disable no-param-reassign */

const { BOTSWANA_TD1 } = require('../formats');

const { getValidLines } = require('../checkLines');
const getResult = require('../getResult');
const BotswanaTD1Fields = require('./botswanaTd1Fields');

module.exports = function parseBotswanaTD1(mrzLines) {
  const lines = getValidLines(mrzLines, 3, 30, BOTSWANA_TD1);
  return getResult(BOTSWANA_TD1, lines, BotswanaTD1Fields);
};
